import React from 'react';
import {Box, Button, Flex, Heading, VStack} from "@chakra-ui/react";

const FoundQuiz = () => {
    return (
        <Box bg={'gray.100'} minH={'100vh'}>
            <Flex w={'100%'} direction={'column'}>
                <Box>
                    <VStack>
                        <Button colorScheme={'teal'}>Start</Button>
                        <Button colorScheme={'teal'}>Start</Button>
                        <Button colorScheme={'teal'}>Start</Button>
                    </VStack>
                </Box>
            </Flex>
        </Box>
    );
};

export default FoundQuiz;
